	add("pollution", "{\"term\":\"pollution\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Recorded since the 1340s, as \u0026quot;discharge of semen other than during sex\u0026quot;, later, \u0026quot;desecration, defilement\u0026quot; (1382), from Late Latin {{l|la|pollutio||defilement}}, from Latin {{l|la|polluere||to soil, defile, contaminate}}, itself from {{l|la|por-||before}} + {{l|la|-luere||to smear}}, related to {{l|la|lutum||mud}} and to {{l|la|lues||filth}}; compare Greek {{l|grc|||filth, dirt, disgrace}} and {{l|grc|||rubbish, refuse}}, Old Irish \u0027loth\u0027 \u0026quot;mud, dirt\u0026quot;, Lithuanian {{l|lt|lutynas||pool, puddle}}. The meaning \u0026quot;that which makes physically foul\u0026quot; is from 1540s. The sense of \u0026quot;contamination of the environment\u0026quot; was first recorded circa 1860, but not common until circa 1955.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of polluting or the state of being polluted, especially the contamination of the environment by harmful substances\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"hazards of gasoline cars: air and water \u0027\u0027pollution\u0027\u0027, noise and noxiousness, constant coughing and the undeniable rise in cancers caused by smoke exhaust particulates\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something that pollutes; a pollutant\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Physical defilement\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The emission of semen at other times than in sexual intercourse\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1839\u0027\u0027, Robley Dunglison, \u0027Medical Lexicon\u0027, Blanchard, page 492 defines \u0027POLLUTION\u0027 as\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The excretion of seminal liquor or sperm, at other times than during coition. When occasioned by a voluntary act it is called, simply, \u0027\u0027\u0027Pollution\u0027\u0027\u0027 or \u0027Masturbation\u0027 (q.v.); when excited, during sleep, by lascivious dreams, it takes the name \u0027Noctur\u0027nal pollution, Exoneiro\u0027sis, Oneirog\u0027mos, Oneirog\u0027onos, Gonorrhœ\u0027a dormien\u0027tium, G. oneirog\u0027onos, G. Vera, G. libidino\u0027sa, Proflu\u0027vium Sem\u0027inis, Spermatorrhœ\u0027a, Paronir\u0027ia salax, Night pollution\", \"priority\":7}]}, \"synonyms\":{}}");

