	add("polygamy", "{\"term\":\"polygamy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Recorded since 1591, from Late Latin \u0027polygamia\u0027 from Ancient greek (to 1453) \u0027πολυγαμία\u0027 itself from \u0027πολύγαμος\u0027 (married to many) \u0026quot; from \u0027πολύς\u0027 (many) + \u0027γάμος\u0027 (marriage) Relates to modern prefix \u0026amp; suffix {{confix|poly|gamy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The having of multiple socially bonded sexual partners at the same tim\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Originally \u0027\u0027polygamy\u0027\u0027 could work either or both ways, but civilisation generally forbids simultaneous husband\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The condition of having more than one spouse or marriage partner at one time\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Kathryn M Daynes, \u0027Plural wives and the nineteenth-century Mormon marriage system\u0027, page 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Because Mormon polygamy was an unusual family form in nineteenth-century America\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Zeitzen, Miriam Koktvedgaard \u0027Polygamy: a cross-cultural analysis\u0027, p\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Muslims and early Mormon communities have been known to practise \u0027\u0027polygamy\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The state or habit of having more than one sexual mate\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An insect queen actually practices \u0027\u0027polygamy\u0027\u0027 only one day, while for an alpha-male defending his harem is the very essence of both his status and \u0027\u0027polygamy\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The condition or state of a plant which bears both perfect and unisexual flowers\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Commonly used specifically for polygyny, the marriage of a man to more than one wife, or the practice of having several wives, at the same time\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The Islamic form of \u0027\u0027polygamy\u0027\u0027 is a husband with up to four wives\", \"priority\":12}]}, \"synonyms\":{}}");

	add("polygenesis", "{\"term\":\"polygenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|poly|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The genesis of a species from more than one ancestor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The theory that living organisms originate in cells or embryos of different kinds, instead of coming from a single cell; as opposed to monogenesis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The theory that languages developed independently in different places at different periods, as opposed to originating from a single source\", \"priority\":3}]}, \"synonyms\":{}}");

