	add("polyhierarchy", "{\"term\":\"polyhierarchy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|hierarchy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hierarchical relationship (tree) in which at least one child has more than one parent\", \"priority\":1}]}, \"synonyms\":{}}");

