	add("polyline", "{\"term\":\"polyline\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|line|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A continuous line composed of one or more line segments\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymath", "{\"term\":\"polymath\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"First attested in 1624; from the Ancient greek (to 1453) \u0027πολυμαθής\u0027 (having learnt much) from \u0027πολύς\u0027 (much) + \u0027μάθη\u0027 (\u0027mathē\u0027, “learning”; from \u0027μανθάνω\u0027 \u0027manthanō\u0027 “I learn”); compare \u0027opsimath\u0027 \u0027philomath\u0027 \u0027polyhistor\u0027 \u0027polymathic\u0027 \u0027polymathist\u0027 and \u0027polymathy\u0027 as well as the French \u0027polymathe\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person with extraordinarily broad and comprehensive knowledge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1624\u0027\u0027, \u0027\u0027 (2\u0026lt;sup\u0026gt;nd\u0026lt;/sup\u0026gt; edn.), p.6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To be thought and held \u0027\u0027Polumathes\u0027\u0027 and Polihistors\", \"priority\":3}]}, \"synonyms\":{}}");

	add("polymeride", "{\"term\":\"polymeride\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|polymer|ide|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Polymer\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymerization", "{\"term\":\"polymerization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|polymerize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The chemical process, normally with the aid of a catalyst, to form a polymer by bonding together multiple identical units (monomers\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymethine", "{\"term\":\"polymethine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|methine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A compound made up from an odd number of methine groups bound together by alternating single and double bonds\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymorph", "{\"term\":\"polymorph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|poly|morph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any organism that shows polymorphis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any substance or mineral that forms different types of crystal\", \"priority\":2}]}, \"synonyms\":{}}");

	add("polymorphism", "{\"term\":\"polymorphism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|poly|morphism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability to assume different forms or shapes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The coexistence, in the same locality, of two or more distinct forms independent of sex, not connected by intermediate gradations, but produced from common parents\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The feature of object-oriented programming pertaining to the dynamic treatment of data elements based on their type, allowing for an instance of a method to have several definitions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The property of certain typed formal systems of allowing for the use of type variables and binders/quantifiers over those type variables; likewise, the property of certain expressions (within such typed formal systems) of making use of at least one such typed variable\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The ability of a solid material to exist in more than one form or crystal structure; pleomorphism\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The regular existence of two or more different genotypes within a given species or population; also, variability of amino acid sequences within a gene\u0027s protein\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027Genome\u0027, Harper Perennial 2004, p. 137\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Since 1990 they have found an entirely new role: they promise understanding of how and why our genes are all so different. They hold the key to human \u0027\u0027polymorphism\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Ancestor\u0027s Tale\u0027, Phoenix 2005, p. 63\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Some \u0027\u0027polymorphisms\u0027\u0027 can be quite stable – so stable that they span the change from an ancestral to a descendant species\", \"priority\":10}]}, \"synonyms\":{}}");

	add("polymorphitis", "{\"term\":\"polymorphitis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|polymorph|itis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In some roguelike games, an intrinsic ability that causes the player\u0027s character to polymorph without warning\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polymorphy", "{\"term\":\"polymorphy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|poly|morphy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The existence of many different forms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polynitrogen", "{\"term\":\"polynitrogen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|nitrogen|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several unstable allotropes of nitrogen that have more than two atoms in each molecule\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polyol", "{\"term\":\"polyol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|poly|ol|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any organic compound having three or more hydroxyl functional groups; a polyhydric alcohol\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027A Short History of Nearly Everything\u0027, BCA 2003, p. 258\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a team at the Ames Research Center in California announced that the Murchison rock also contained complex strings of sugars called \u0027\u0027polyols\u0027\u0027, which had not been found off the Earth before\", \"priority\":3}]}, \"synonyms\":{}}");

	add("polyoma", "{\"term\":\"polyoma\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|poly|oma|t1\u003dmany|t2\u003dtumor|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small form of the papovavirus that causes tumors in rodents\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polyorchidism", "{\"term\":\"polyorchidism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|polyorchid|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The medical condition of having more than two testicles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Most \u0027\u0027polyorchid\u0027\u0027 men have a third smaller underdeveloped testis. It can be removed, but does not cause any health concerns if it remains\", \"priority\":2}]}, \"synonyms\":{}}");

	add("polyparasitism", "{\"term\":\"polyparasitism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|parasitism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The presence of multiple parasites on the same hos\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polyploidy", "{\"term\":\"polyploidy\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From {{suffix|polyploid|y|lang\u003den}}, after German \u0027polyploidie\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being a polyploid; having more than the usual two homologous sets of chromosomes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Terence Allen and Graham Cowling, \u0027The Cell: A Very Short Introduction\u0027, Oxford 2011, p. 90\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As they mature, the DNA is replicated several times but the cell does not divide, a condition known as \u0027\u0027polyploidy\u0027\u0027 which allows cells to increase in size\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21605869-vegetable-kingdom-more-sets-chromosomes-are-often-better-double-or Double or passage\u003dThis propensity to \u0027\u0027polyploidy\u0027\u0027 helps account for the diversity (and thus success) of flowering plants, in particular. It is also known that flowering plants sailed majestically through the life-destroying asteroid impact at the end of the Cretaceous period, which did for the dinosaurs and many other animals\", \"priority\":4}]}, \"synonyms\":{}}");

	add("polypody", "{\"term\":\"polypody\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027polypodie\u0027 and its source, \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of many ferns of the genus \u0027Polypodium\u0027, especially\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.4.2.ii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Polypodie\u0027\u0027 and epithyme are, without all exceptions, gentle purgers of melancholy\u0026amp;nbsp;[\u0026amp;hellip\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1653\u0027\u0027, \u0027The English Physician Enlarged\u0027, Folio Society 2007, p. 226\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"If the humour be otherwise choose your \u0027\u0027Polypody\u0027\u0027 accordingly\", \"priority\":5}]}, \"synonyms\":{}}");

	add("polyptoton", "{\"term\":\"polyptoton\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Via Latin from Ancient greek (to 1453) \u0027πολύπτωτον\u0027 () neuter of \u0027πολύπτωτος\u0027 (having many cases) from \u0027πολύς\u0027 (many) + \u0027πίπτω\u0027 (i fall)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stylistic scheme in which words from the same root are used together, or a word is repeated in a different inflection or case\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polyptych", "{\"term\":\"polyptych\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027πολύπτυχος\u0027 (with many folds) from \u0027πολύς\u0027 (many) + \u0027πτυχή\u0027 (a fold)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a work consisting of multiple painted or carved panels joined together, often with hinges\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polypurine", "{\"term\":\"polypurine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|purine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A continuous sequence of purines in a protein\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polypyridine", "{\"term\":\"polypyridine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|pyridine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any compound containing multiple linked pyridine rings\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polyreaction", "{\"term\":\"polyreaction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|reaction|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A polymerization or polycondensation reactio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Nonspecific reaction towards a range of materials\", \"priority\":2}]}, \"synonyms\":{}}");

