	add("polyscope", "{\"term\":\"polyscope\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|scope|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lens that has multiple facets and forms multiple image\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A device for viewing the cavities of the body\", \"priority\":2}]}, \"synonyms\":{}}");

