	add("polyseme", "{\"term\":\"polyseme\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|seme|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word or phrase that has multiple meanings\", \"priority\":1}]}, \"synonyms\":{}}");

	add("polystyrene", "{\"term\":\"polystyrene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|styrene|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vinylic polymer of styrene, CH\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;CHphenyl\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An alkane chain of benzene molecules, RCH\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;CHphenylR\", \"priority\":2}]}, \"synonyms\":{}}");

	add("polysyllable", "{\"term\":\"polysyllable\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|poly|syllable|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word with more than two syllables. Sometimes used in a more restricted sense\", \"priority\":1}]}, \"synonyms\":{}}");

