	add("polytheism", "{\"term\":\"polytheism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French {{m|fr|polythéisme}}, from Ancient greek (to 1453) \u0027πολύς\u0027 (many) and \u0027θεός\u0027 (god) corresponding to {{prefix|poly|theism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief in the existence of multiple gods\", \"priority\":1}]}, \"synonyms\":{}}");

